class Recipe extends Component {
  constructor(props) {
    super(props);
    this.state = {
      selectedItems: [],
      items: [
        "10 Bread loaves",
        "1L Milk Carton",
        "50g Mushrooms",
        "3 Eggs",
        "300g Rice",
        "5 Onions"
      ],
      filter: "", // dropdown filter
      recipes: [], // store recipes from API or placeholders
      loading: false,
      showPlaceholders: false, // toggle view
    };
  }

  toggleItem = (item) => {
    this.setState((prevState) => {
      const alreadySelected = prevState.selectedItems.includes(item);
      return {
        selectedItems: alreadySelected
          ? prevState.selectedItems.filter((i) => i !== item)
          : [...prevState.selectedItems, item]
      };
    });
  };

  handleFilterChange = (e) => {
    this.setState({ filter: e.target.value });
  };

  handleGenerate = async () => {
    // Show placeholder recipes instead of error
    const placeholderRecipes = [
      { title: "Recipe 1", prepTime: "15 mins", image: "https://via.placeholder.com/200x120", badges: ["Easy"] },
      { title: "Recipe 2", prepTime: "20 mins", image: "https://via.placeholder.com/200x120", badges: ["Quick"] },
      { title: "Recipe 3", prepTime: "30 mins", image: "https://via.placeholder.com/200x120", badges: ["Healthy"] }
    ];

    this.setState({ recipes: placeholderRecipes, showPlaceholders: true });
  };

  handleBack = () => {
    this.setState({ showPlaceholders: false, recipes: [] });
  };

  handleSave = (recipe) => {
    console.log("Saved recipe:", recipe);
    alert(`Saved ${recipe.title}!`);
    // Here you can also implement saving to a database or localStorage
  };

  render() {
    const { selectedItems, items, filter, recipes, showPlaceholders } = this.state;

    return (
      <div className="recipe-container">
        {!showPlaceholders ? (
          // Original generate recipe panel
          <div className="recipe-card">
            <h2 className="recipe-title">AI Recipe Generator</h2>
            <p className="recipe-subtitle">Select items to incorporate:</p>

            <div className="recipe-list">
              {items.map((item, index) => (
                <label key={index}>
                  <input
                    type="checkbox"
                    checked={selectedItems.includes(item)}
                    onChange={() => this.toggleItem(item)}
                  />
                  {item}
                </label>
              ))}
            </div>

            {/* Filter Dropdown */}
            <div className="filter-dropdown">
              <label htmlFor="recipe-filter">Filter Recipes: </label>
              <select id="recipe-filter" value={filter} onChange={this.handleFilterChange}>
                <option value="">All</option>
                <option value="Vegan">Vegan</option>
                <option value="Vegetarian">Vegetarian</option>
                <option value="Gluten-Free">Gluten-Free</option>
              </select>
            </div>

            <button className="generate-btn" onClick={this.handleGenerate}>
              Generate
            </button>
          </div>
        ) : (
          // Placeholder recipes view
          <div className="recipe-results">
            {recipes.map((recipe, index) => (
              <div key={index} className="recipe-result-card">
                <img src={recipe.image} alt={recipe.title} />
                <h3>{recipe.title}</h3>
                <p>Prep: {recipe.prepTime}</p>
                {recipe.badges?.map((badge, i) => (
                  <span key={i} className="badge">{badge}</span>
                ))}
                <button className="save-btn" onClick={() => this.handleSave(recipe)}>Save</button>
              </div>
            ))}
            <button
              className="generate-btn"
              style={{ marginTop: "20px", width: "200px" }}
              onClick={this.handleBack}
            >
              Back
            </button>
          </div>
        )}
      </div>
    );
  }
}

export default Recipe;
